        return (
            <li className="list-group-item">
                <img src={props.img} alt={`icon of ^${this.id}` }/>
            <input className="form-check-input me-1" type="checkbox" id={props.id } />
                <label htmlFor={props.id }> {props.media }</label>
            </li> 
        )
    }

export default SocialItem;
